/* Function  structure for function  `GetTotalHour` */

/*!50003 DROP FUNCTION IF EXISTS `GetTotalHour` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetTotalHour`(TimeIn varchar(50), TimeOut varchar(50)) RETURNS double
BEGIN
	/* Function created by Eng'r Nolan F. Sunico January 07, 2008 to handle overtime conflict */
	declare td bit(1); # Bit is a boolean data type storable values is true or false
	set td= (TimeOut - TimeIn) <0; /* if td < 0 therefore its next day */
	if td then /* Out next day OT */
           set TimeIn=concat('2009-12-30',' ',TimeIn);
	   set TimeOut=concat('2009-12-31',' ', TimeOut);
        else /* Out same day OT */
           set TimeIn=concat('2009-12-30',' ',TimeIn);
	   set TimeOut=concat('2009-12-30',' ', TimeOut);
        end if;
        return ifnull((hour(TIMEDIFF(ifnone(TimeOut,TimeIn),TimeIn)) + minute(TIMEDIFF(ifnone(TimeOut,TimeIn), TimeIn))/60),0);
    END */$$
DELIMITER ;

