/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertIntoDtr`(eID varchar(250),bDate date,eDate date,regRate decimal(10,4),colRate decimal(10,4),
     nDays double(4,2),iRot double(10,2), iND double(10,2), iRS double(10,2), iSot double(10,2), iSnd double(10,2), 
     iLHR double(10,2), iLHot double(10,2), iLHnd double(10,2), iSLH double(10,2), iSHot double(10,2), iSHnd double(10,2),
     iNP double(10,2), iDeductionID bigint(10), iDTRID decimal(50,0), iDepartmentID varchar(100), 
     iTotNumDays double(4,2), iRegOTMul double(5,4), iNightDiffMul double(5,4), iRegSunMul double(5,4), iSunOTMul double(5,4), 
     iSunNightDiffMul double(5,4), iRegLegalHoliMul double(5,4), iLegalHoliOTMul double(5,4), 
