     iSunHoliNightDiffMul double(5,4), iNightPremiumMul double(5,4), iSalaryMode varchar(250))
BEGIN
	/* Stored procedure by Eng'r Nolan Sunico  */
	INSERT INTO dtr
	(EmployeeID, BeginDate, EndDate, RegularRate, ColaRate, 
	NumberDays, Rot, ND, RS, Sot, Snd, LHR, LHot, LHnd, SLH, 
	SHot, SHnd, NP, DeductionID, DTRID, DepartmentID, 
	TotNumDays, RegOTMul, NightDiffMul, RegSunMul, SunOTMul, 
	SunNightDiffMul, RegLegalHoliMul, LegalHoliOTMul, 
