/* Procedure structure for procedure `spGenerateDTR` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGenerateDTR` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `spGenerateDTR`(iStartDate date,iEndDate date)
    READS SQL DATA
BEGIN
	-- Variable Declaration
	DECLARE done INT DEFAULT FALSE;
	declare cnt int(11);
	declare pvalue date;
	declare cvalue int(11);
	declare xvalue int(11);
	DECLARE `EmployeeID` VARCHAR(255);
	DECLARE `dtrDate` DATE;
	declare `dtrTime` TIME;
	DECLARE `TimeInAM` TIME;
	DECLARE `TimeOutAM` TIME;
	DECLARE `TimeInPM` TIME;
	DECLARE `TimeOutPM` TIME;
	DECLARE `TimeInOT` TIME;
	DECLARE `TimeOutOT` TIME;
	DECLARE `TimeInAM2` TIME;
	DECLARE `TimeOutAM2` TIME;
	DECLARE `TimeInPM2` TIME;
	DECLARE `TimeOutPM2` TIME;
	DECLARE `TimeInOT2` TIME;
	DECLARE `TimeOutOT2` TIME;
	DECLARE `count` int(11);	
	
	DECLARE `Existing` INT(11);
   	DECLARE my_cursor CURSOR FOR SELECT EmployeeCode,DATE(importdtr_date) AS importdtr_date,TIME(importdtr_date) AS importdtr_time FROM tblimportdtr WHERE DATE(`tblimportdtr`.`importdtr_date`) 
	BETWEEN iStartDate AND iEndDate ORDER BY EmployeeCode,importdtr_date,importdtr_time;
	
	
	SET done = 0;
	set cnt = 1;
	set pvalue = 0;
	set cvalue = 0;
	set xvalue = 0;
	set `count` = 1;
	OPEN my_cursor;
	     read_loop : LOOP
		FETCH my_cursor INTO EmployeeID,dtrDate,dtrTime;
		-- SELECT COUNT(*) AS exist INTO cvalue FROM tblimportdtr WHERE `tblimportdtr`.`EmployeeCode` = EmployeeID AND `tblimportdtr`.`dtrDate` = dtrDate LIMIT 1;
		SELECT COUNT(`tblimportdtr`.`importdtr_id`) AS exist into cvalue FROM `tblimportdtr` 
		WHERE `tblimportdtr`.`EmployeeCode` = EmployeeID AND DATE(`tblimportdtr`.`importdtr_date`) = dtrDate limit 1;
		
		
		
		if cnt=1 then 
			-- SET xvalue = cvalue;
			INSERT INTO tmpdtr (`EmployeeID`,`dtrDate`,`TimeInAM`,`CountLine`) 
			VALUES (EmployeeID,dtrDate,dtrTime,`count`);
		end if;
		
			
		IF cnt=2 THEN 
	
			INSERT INTO tmpdtr (`EmployeeID`,`dtrDate`,`TimeInAM`,`CountLine`) 
			VALUES (EmployeeID,dtrDate,dtrTime,`count`)
			ON DUPLICATE KEY UPDATE TimeOutAM=IF(TimeOutAM IS NULL,dtrTime ,TimeOutAM);
		END IF;
		
		if cnt=3 then
		
			INSERT INTO tmpdtr (`EmployeeID`,`dtrDate`,`TimeInAM`,`CountLine`) 
			VALUES (EmployeeID,dtrDate,dtrTime,`count`)
			ON DUPLICATE KEY UPDATE TimeInPM=IF(TimeInPM IS NULL,dtrTime, TimeInPM);
		end if;
		
		IF cnt=4 THEN
	
			INSERT INTO tmpdtr (`EmployeeID`,`dtrDate`,`TimeInAM`,`CountLine`) 
			VALUES (EmployeeID,dtrDate,dtrTime,`count`)
			ON DUPLICATE KEY UPDATE TimeOutPM=IF(TimeOutPM IS NULL,dtrTime,TimeOutPM);
		END IF;
		
		IF cnt=5 THEN
		
			INSERT INTO tmpdtr (`EmployeeID`,`dtrDate`,`TimeInAM`,`CountLine`) 
			VALUES (EmployeeID,dtrDate,dtrTime,`count`)
			ON DUPLICATE KEY UPDATE TimeInOT=IF(`TimeInOT` IS NULL,dtrTime,`TimeInOT`);
		END IF;
		
		IF cnt=6 THEN
	
			INSERT INTO tmpdtr (`EmployeeID`,`dtrDate`,`TimeInAM`,`CountLine`) 
			VALUES (EmployeeID,dtrDate,dtrTime,`count`)
			ON DUPLICATE KEY UPDATE `TimeOutOT`=IF(`TimeOutOT` IS NULL,dtrTime,`TimeOutOT`);
		END IF;
		
	
		IF cnt = cvalue THEN
		  SET cnt=1;
		  SET `count` = `count` + 1;
		  ELSE  	
		  SET cnt=cnt+1;
		END IF;	
	
	
		IF done THEN
		   LEAVE read_loop;
		END IF;
	   END LOOP;
	   
		   
	   
	 CLOSE my_cursor;
	 
	 
	 
	 -- CALL `RecomputeTmpDtr`(1,1); 
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spGenerateMonthlyWeekly` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGenerateMonthlyWeekly` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spGenerateMonthlyWeekly`(
	iBeginDate date,
	iDepartmentName varchar(250),
	iSalaryMode varchar(250),
	iUser varchar(100),
	iCertifiedDesignation varchar(100),
	iNotedbyDesignation varchar(100),
	iApprovedbyDesignation varchar(100),
	iPreparedDesignation varchar(100))
    MODIFIES SQL DATA
BEGIN
	-- Stored Procedure created by Eng'r Nolan F. Sunico
	-- November 8, 2012 - 10:34 AM
	-- This Procedure Generates Monthly-Weekly Payroll
	SELECT Recnum, EmployeeID, Fullname, DepartmentName, BeginDate, EndDate, RegularRate, 
	ColaRate, NumberDays, RatePerHour, RotDue, NDDue, RSDue, SotDue, SndDue, LHRDue, LHotDue, 
	LHndDue, SLHDue, SHotDue, SHndDue, NPDue, RegularSalary, Cola, AdditionalCompensation, `Gross Salary`, 
	`Net Salary`, ucase(SalaryMode) as `SalaryMode`, RestrictDtr, Unpaid_Obligation, SSSNumber, Preparedby, Certifiedby, Notedby, 
	Approvedby, SSSCon AS SSSContribution, Philhealth AS Philhealth, CA AS `Cash Advance`, HDMFLoan AS `HDMF Loan`, 
	HDMFCon AS `HDMF Contribution`, ITW AS TaxWithheld, SSSLoan AS `SSS Loan`, HousingLoan AS `Housing Loan`, 
	(RegularRate / ReturnMonthlyRateMul()) AS MonthlyRate, iUser as Username, iCertifiedDesignation as CertifiedDesignation,
	iNotedbyDesignation as NotedbyDesignation, iApprovedbyDesignation as ApprovedbyDesignation, 
	iPreparedDesignation as PreparedDesignation
	FROM monthlypayroll 
	WHERE BeginDate=iBeginDate AND DepartmentName=iDepartmentName AND SalaryMode=iSalaryMode  
	ORDER BY Fullname;
	-- End of Stored Procedure
	END */$$
DELIMITER ;

/* Procedure structure for procedure `spGenerateTardiness` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGenerateTardiness` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spGenerateTardiness`()
    READS SQL DATA
BEGIN
	-- Variable Declaration
	DECLARE done INT DEFAULT FALSE;
	DECLARE dtr_id INT(11);
	DECLARE employee_id VARCHAR(100);
	DECLARE fullname VARCHAR(100);
	DECLARE time_id INT(11);
	DECLARE dtr_date DATE;
	DECLARE timein_am TIME;
	DECLARE timeout_am TIME;
	DECLARE timein_pm TIME;
	DECLARE timeout_pm TIME;
	DECLARE timein_ot TIME;
	DECLARE timeout_ot TIME;
	DECLARE late_morning TIME;
	DECLARE morningout_late TIME;
	DECLARE afternoonin_late TIME;
	DECLARE afternoonout_late TIME;
	
	-- 1st Cursor	
	DECLARE my_cursor CURSOR FOR SELECT tmpdtr.`tmpDTRID`,`tmpdtr`.`EmployeeID` , CONCAT(tblemployee.`Lastname`,', ',`tblemployee`.`Firstname`,' ',`tblemployee`.`Middlename`) AS Fullname,`tbltimeconfiguration`.`TimeID`,
tmpdtr.`dtrDate` , IFNULL(tmpdtr.`TimeInAM`,''),IFNULL(`tmpdtr`.`TimeOutAM`,''),IFNULL(`tmpdtr`.`TimeInPM`,''),IFNULL(`tmpdtr`.`TimeOutPM`,''),IFNULL(`tmpdtr`.`TimeInOT`,''),IFNULL(`tmpdtr`.`TimeOutOT`,''),
IFNULL(IF((TIME_TO_SEC(TIMEDIFF(tmpdtr.`TimeInAM`,`tbltimeconfiguration`.`MorningIn`))/3600) < 0,0,TIMEDIFF(tmpdtr.`TimeInAM`,`tbltimeconfiguration`.`MorningIn`)),'') AS LateMorning,
IFNULL(IF((TIME_TO_SEC(TIMEDIFF(tmpdtr.`TimeOutAM`,`tbltimeconfiguration`.`AfternoonIn`))/3600) < 0,0,TIMEDIFF(tmpdtr.`TimeOutAM`,`tbltimeconfiguration`.`AfternoonIn`)),'') AS MorningOutLate,
IFNULL(IF((TIME_TO_SEC(TIMEDIFF(tmpdtr.`TimeInPM`,`tbltimeconfiguration`.`AfternoonIn`))/3600) < 0,0,TIMEDIFF(tmpdtr.`TimeInPM`,`tbltimeconfiguration`.`AfternoonIn`)),'') AS AfternoonInLate,
IFNULL(IF((TIME_TO_SEC(TIMEDIFF(tbltimeconfiguration.`AfternoonOut`,`tmpdtr`.`TimeOutPM`))/3600) < 0,0,TIMEDIFF(tbltimeconfiguration.`AfternoonOut`,`tmpdtr`.`TimeOutPM`)),'') AS AfternoonOutLate
FROM tmpdtr
INNER JOIN tblemployee
ON tmpdtr.`EmployeeID` = tblemployee.`BiometricID`
INNER JOIN tbltimeconfiguration
ON tbltimeconfiguration.`TimeID` = tblemployee.`TimeID`
WHERE IF((TIME_TO_SEC(TIMEDIFF(tmpdtr.`TimeInAM`,`tbltimeconfiguration`.`MorningIn`))/3600) < 0,0,TIMEDIFF(tmpdtr.`TimeInAM`,`tbltimeconfiguration`.`MorningIn`)) <> 0 OR
IF((TIME_TO_SEC(TIMEDIFF(tmpdtr.`TimeOutAM`,`tbltimeconfiguration`.`AfternoonIn`))/3600) < 0,0,TIMEDIFF(tmpdtr.`TimeOutAM`,`tbltimeconfiguration`.`AfternoonIn`)) <> 0 OR 
IF((TIME_TO_SEC(TIMEDIFF(tmpdtr.`TimeInPM`,`tbltimeconfiguration`.`AfternoonIn`))/3600) < 0,0,TIMEDIFF(tmpdtr.`TimeInPM`,`tbltimeconfiguration`.`AfternoonIn`)) <> 0 OR
IF((TIME_TO_SEC(TIMEDIFF(tbltimeconfiguration.`AfternoonOut`,`tmpdtr`.`TimeOutPM`))/3600) < 0,0,TIMEDIFF(tbltimeconfiguration.`AfternoonOut`,`tmpdtr`.`TimeOutPM`)) <> 0
ORDER BY EmployeeID;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
        DROP TABLE IF EXISTS tempsdtr;
	CREATE TEMPORARY TABLE tempsdtr (
	temp_id INT(11) NOT NULL AUTO_INCREMENT,
	dtr_id INT(11),
	employee_id VARCHAR(100), 
	fullname VARCHAR(100),
	time_id INT(11),
	dtr_date DATE,
	timein_am TIME,
	timeout_am TIME,
	timein_pm TIME,
	timeout_pm TIME,
	timein_ot TIME,
	timeout_ot TIME,
	late_morning TIME,
	morningout_late TIME,
	afternoonin_late TIME,
	afternoonout_late TIME,
	PRIMARY KEY (temp_id)
	) ENGINE=MEMORY;	
  OPEN my_cursor;
  read_loop: LOOP
    FETCH my_cursor 
INTO dtr_id,employee_id,fullname,time_id,dtr_date,timein_am,timeout_am,timein_pm,timeout_pm,timein_ot,timeout_ot,late_morning,morningout_late,afternoonin_late,afternoonout_late;
    SET @SQL=CONCAT("INSERT INTO tempsdtr(`dtr_id`,`employee_id`,`fullname`,`time_id`,`dtr_date`,`timein_am`,`timeout_am`,`timein_pm`,
    `timeout_pm`,`timein_ot`,`timeout_ot`,`late_morning`,`morningout_late`,`afternoonin_late`,`afternoonout_late`) 
    VALUES('", dtr_id , 
    "','" , employee_id ,
    "','" , fullname ,
    "','" , time_id ,
    "','" , dtr_date ,
    "','" , timein_am ,
    "','" , timeout_am ,
    "','" , timein_pm ,
    "','" , timeout_pm ,
    "','" , timein_ot ,
    "','" , timeout_ot ,
    "','" , late_morning ,
    "','" , morningout_late ,
    "','" , afternoonin_late ,
    "','" , afternoonout_late,"');");
	PREPARE stmt1 FROM @SQL;
	EXECUTE stmt1;
	DEALLOCATE PREPARE stmt1;
    IF done THEN
       LEAVE read_loop;
    END IF;
  END LOOP;
  CLOSE my_cursor;	
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spTardiness` */

/*!50003 DROP PROCEDURE IF EXISTS  `spTardiness` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spTardiness`(
    iType varchar(11),
    iStart date,
    iEnd date,
    isolo int(1),
    isearch varchar(100)
    )
    READS SQL DATA
BEGIN
CALL spGenerateTardiness();
IF isolo=0 THEN
	IF iType="All" THEN	
	SELECT * FROM tempsdtr WHERE dtr_date BETWEEN iStart AND iEnd ORDER BY employee_id,dtr_date ASC;
	END IF;
	IF iType="Count" THEN	
	SELECT *,COUNT(employee_id) AS cnt FROM tempsdtr WHERE dtr_date BETWEEN iStart AND iEnd GROUP BY employee_id ORDER BY employee_id,dtr_date ASC;
	END IF;
	IF iType="Detailed" THEN	
	SELECT * FROM tempsdtr WHERE dtr_date BETWEEN iStart AND iEnd ORDER BY dtr_date ASC;
	END IF;
else
	IF iType="All" THEN	
	SELECT * FROM tempsdtr WHERE dtr_date BETWEEN iStart AND iEnd and fullname LIKE concat('%',isearch,'%') ORDER BY employee_id,dtr_date ASC;
	END IF;
	IF iType="Count" THEN	
	SELECT *,COUNT(employee_id) AS cnt FROM tempsdtr WHERE dtr_date BETWEEN iStart AND iEnd AND fullname LIKE CONCAT('%',isearch,'%') GROUP BY employee_id ORDER BY employee_id,dtr_date ASC;
	END IF;
	IF iType="Detailed" THEN	
	SELECT * FROM tempsdtr WHERE dtr_date BETWEEN iStart AND iEnd AND fullname LIKE CONCAT('%',isearch,'%') ORDER BY employee_id,dtr_date ASC;
	END IF;
	
end if;
END */$$
DELIMITER ;

