/* Procedure structure for procedure `UpdateExemption` */

/*!50003 DROP PROCEDURE IF EXISTS  `UpdateExemption` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateExemption`(STAT VARCHAR(250), NumOfDependent decimal(12,4))
BEGIN
	/* Stored procedure by Eng'r Nolan Sunico  */
	update exemption set ExemptionCode = Concat(left(STAT, 1), NumOfDependent) Where ExemptionStatus = STAT AND NumberOfDependent =NumOfDependent ;
END */$$
DELIMITER ;

/* Procedure structure for procedure `Weekly` */

/*!50003 DROP PROCEDURE IF EXISTS  `Weekly` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `Weekly`(sDate Date, eDate Date, EndDate Date )
BEGIN
	/* Stored procedure by Eng'r Nolan Sunico  */
	SELECT COUNT(*) AS RecNum, a.* 
	FROM calculatedpayslip a  JOIN
	calculatedpayslip b ON a.DTRID >= b.DTRID
	WHERE (a.BeginDate BETWEEN sDate AND eDate) AND 
	a.EndDate <= EndDate
	GROUP BY a.DTRID
	ORDER BY RecNum, a.Fullname;
END */$$
DELIMITER ;

